            Re  = np.matrix([[cos(r1_x_e[2,0]), -sin(r1_x_e[2,0]), 0], [sin(r1_x_e[2,0]), cos(r1_x_e[2,0]), 0], [0,0,1]])
            self.obj_pose = r1_x_e - np.dot(Re, self.p1o_in_e1) #[(r1_x_e[0,0] + r2_x_e[0,0])/2, (r1_x_e[1,0] + r2_x_e[1,0] - self.ees_y_off)/2, r1_x_e[2,0] - self.omega_off]
