            self.obj_vel = np.dot(J_1o, r1_v_e) # [(r1_v_e[0,0] + r2_v_e[0,0])/2, (r1_v_e[1,0] + r2_v_e[1,0])/2, r1_v_e[2,0]]
            obj_array_vel = self.obj_vel#np.asarray(self.obj_vel)[np.newaxis].T
